var $bm_rt;
var amorti, freq, speedLimit, rebond, tempsClefProx, tempsDebut, tempsDebut, temps, spring, spring;
amorti = effect('Rotation Spring')(2);
freq = effect('Rotation Spring')(1);
speedLimit = effect('Rotation Spring')(4);
$bm_rt = rebond = effect('Rotation Spring')(3);
if (numKeys > 1 && freq != 0) {
    if (nearestKey(time).index == 1) {
        $bm_rt = value;
    } else {
        if (length(velocity) <= speedLimit) {
            tempsClefProx = nearestKey(time).time;
            if (tempsClefProx <= time) {
                tempsDebut = tempsClefProx;
            } else {
                tempsDebut = key($bm_sub(nearestKey(time).index, 1)).time;
            }
            temps = $bm_sub(time, tempsDebut);
            $bm_rt = spring = $bm_mul(velocityAtTime($bm_sub(tempsDebut, thisComp.frameDuration)), $bm_div($bm_mul($bm_div(0.15, freq), Math.sin($bm_mul($bm_mul($bm_mul(freq, temps), 2), Math.PI))), Math.exp($bm_mul(temps, amorti))));
            if (speedLimit > 0)
                $bm_rt = spring = $bm_mul(spring, $bm_sub(1, $bm_div(length(velocity), speedLimit)));
            if (rebond == 0)
                $bm_rt = $bm_sum(valueAtTime(tempsDebut), spring);
            if (rebond == 1 && valueAtTime(tempsDebut - thisComp.frameDuration) > valueAtTime(tempsDebut))
                $bm_rt = $bm_sum(valueAtTime(tempsDebut), Math.abs(spring));
            if (rebond == 1 && valueAtTime(tempsDebut - thisComp.frameDuration) < valueAtTime(tempsDebut))
                $bm_rt = $bm_sub(valueAtTime(tempsDebut), Math.abs(spring));
        } else {
            $bm_rt = value;
        }
    }
} else {
    $bm_rt = value;
}

